extension String {
    subscript(_ index: Int) -> Character {
        let stringIndex = self.index(self.startIndex, offsetBy: index)
        return self[stringIndex]
    }
    
    subscript(_ range: Range<Int>) -> String {
        let lowerIndex = self.index(self.startIndex, offsetBy: range.lowerBound)
        let upperIndex = self.index(self.startIndex, offsetBy: range.upperBound)
        return String(self[lowerIndex..<upperIndex])
    }
    
    subscript(_ range: ClosedRange<Int>) -> String {
        let lowerIndex = self.index(self.startIndex, offsetBy: range.lowerBound)
        let upperIndex = self.index(self.startIndex, offsetBy: range.upperBound)
        return String(self[lowerIndex...upperIndex])
    }

    func hasPostfix(_ postfix: String) -> Bool {
        return String(reversed()).hasPrefix(String(postfix.reversed()))
    }
}

class ListNode: CustomStringConvertible {
    var val: Int
    var next: ListNode?
    init(_ val: Int) {
        self.val = val
        self.next = nil
    }

    var count: Int {
        get {
            return (1 + (next?.count ?? 0))
        }
    }

    func insert(_ value: Int) -> ListNode {
        next = ListNode(value)
        return next!
    }
    
    var description: String {
        get {
            var str = String(val)
            if next != nil {
                str += " -> " + next!.description
            }
            return str
        }
    }
}

func generateParenthesis(_ n: Int) -> [String] {
    if n == 0 {
        return [""]
    }
    if n == 1 {
        return ["()"]
    }

    var result = [String]()
    for i in 0..<n {
        let lefts = generateParenthesis(i)
        let middles = generateParenthesis(n-1-i)
        for left in lefts {
            for middle in middles {
                result.append("\(left)(\(middle))")
            }
        }
    }

    return result
}

