func nextPermutation(_ nums: inout [Int]) {
    if nums.count < 2 {
        return
    }

    nums.reverse()
    let pivotIndex: Int? = nums.enumerated().reduce(nil){($0 == nil && $1.offset < nums.count - 1 &&  $1.element > nums[$1.offset + 1]) ? $1.offset + 1 : $0}
    if pivotIndex == nil {
        return
    }
    let pivotNum = nums[pivotIndex!]
    let swapIndex: Int? = nums.enumerated().reduce(nil){($0 == nil && $1.element > pivotNum) ? $1.offset : $0}
    if swapIndex == nil {
        return
    }
    nums.swapAt(pivotIndex!, swapIndex!)
    nums.reverseBetween(0, pivotIndex! - 1)
    nums.reverse()
}

extension Array {
    mutating func reverseBetween(_ a: Int, _ b: Int) {
        var aa = a, bb = b
        while aa < bb, aa < count, bb < count {
            swapAt(aa, bb)
            aa += 1
            bb -= 1
        }
    }
}
