func trap(_ height: [Int]) -> Int {
    var maxHeight = 0
    let leftMax: [Int] = height.map { n in 
        defer {maxHeight = max(maxHeight, n)}
        return maxHeight
    }
    print(leftMax)

    maxHeight = 0
    var rightMax: [Int] = height.reversed().map { n in 
        defer {maxHeight = max(maxHeight, n)}
        return maxHeight
    }

    rightMax.reverse()
    print(rightMax)

    let result: Int =  (0..<height.count).reduce(0) {(result, index) in 
        let water = min(leftMax[index], rightMax[index]) - height[index]
        if water < 0 {return result}
        else {return result + water}
    }
    return result
}

