func myPow(_ x: Double, _ n: Int) -> Double {
    if n == 0 {return 1.0}   
    if n < 0 {return 1.0/myPow(x, -n)}
    if n == 1 {return x}
    let half = myPow(x, n/2)
    return half * half * (n%2 == 1 ? x : 1.0)
}

