class Interval: CustomStringConvertible {
    var start: Int
    var end: Int
    init(_ start: Int, _ end: Int) {
    self.start = start
    self.end = end
    }

    func overlap(_ other: Interval) -> Bool {
        return (other.start >= self.start && other.start <= self.end) || (self.start >= other.start && self.start <= other.end)
    }

    func merge(_ other: Interval) {
        self.start = min(self.start, other.start)
        self.end = max(self.end, other.end)
    }

    var description: String {
        get {
            return "[\(start), \(end)]"
        }
    }
}


func insert(_ intervals: [Interval], _ newInterval: Interval) -> [Interval] {
    return intervals.reduce(into: [Interval]()){ lastResult, interval in 
        if lastResult.count == 0 {
            lastResult.append(interval)
        }

        let lastInterval = lastResult.last!

        if lastInterval.overlap(newInterval) {
            lastInterval.merge(newInterval)
        }
    }
}
