func longestConsecutive(_ nums: [Int]) -> Int {
    let numSet = Set<Int>(nums)
    var maxSequence = 0
    nums.forEach{num in 
        if !numSet.contains(num - 1) {
            var tmp = num
            var count = 1
            while numSet.contains(tmp + 1) {
                tmp += 1
                count += 1
            }
            maxSequence = max(maxSequence, count)
        }
    }
    return maxSequence
}

