func wordBreak(_ s: String, _ wordDict: [String]) -> [String] {
    let wordSet = Set<String>(wordDict)
    var dp = Array<[(Int, Int)]>(repeating: [], count: s.count)
    for i in 0..<s.count {
        let sub = s[0...i]
        for word in wordSet {
            if word.count <= sub.count {
                if sub.hasPostfix(word), (i - word.count < 0 || dp[i - word.count].count > 0) {
                    dp[i].append((i+1 - word.count,i))
                }
            }
        }
    }
    var result: [String] = []
    wordBreak(s, dp, s.count-1, &result, "")
    return result
}

func wordBreak(_ s: String, _ dp: [[(Int, Int)]], _ index: Int, _ result: inout [String], _ tmp: String) {
    if(index == -1) {
        result.append(tmp)
        return
    }

    let tupleList = dp[index]
    for tuple in tupleList {
        wordBreak(s, dp, tuple.0 - 1, &result, s[tuple.0...tuple.1] + (tmp.count == 0 ? "" : " ") + tmp)
    }
}

