extension Character {
    func toAsciiInt() -> Int? {
        if let unicode = self.unicodeScalars.first,
            unicode.isASCII {
            return Int(unicode.value)
        }
        return nil
    }

    init?(_ asciiValue: Int) {
        if asciiValue >= 0, asciiValue <= 127, 
            let unicode = Unicode.Scalar(asciiValue) {
                self.init(unicode)
        }
        return nil
    }
}

struct TreeNode {
    var word: String?
    var letter: Character?
    var nodes: [TreeNode?]
    init(_ c: Character) {
        self.letter = c
        self.nodes = Array<TreeNode?>(repeating: nil, count: 26)
    }

    init() {
        self.init(Character(Unicode.Scalar(0)!))
    }

    mutating func insert(_ word: String) {
        self.insert(word, 0, &self)
    }

    private func insert(_ word: String, _ index: Int, _ node: inout TreeNode) {
        if index >= word.count {
            return
        }
        let c = word[index]
        let ascii = c.toAsciiInt()! - Character("a").toAsciiInt()!
        if node.nodes[ascii] == nil {
            node.nodes[ascii] = TreeNode(c)
        }
        if index == word.count - 1 {
            node.nodes[ascii]!.word = word
        } else {
            insert(word, index + 1, &node.nodes[ascii]!)
        }


    }
}

func buildTrieTree(_ words: [String]) -> TreeNode {
    var root = TreeNode()
    words.forEach{root.insert($0)}
    return root
}

func findWords(_ board: [[Character]], _ words: [String]) -> [String] {
    let root = buildTrieTree(words)
    var result: Set<String> = []
    var visited = board.map { $0.map { $0 == nil } }
    for i in 0..<board.count {
        for j in 0..<board[i].count {
            findWords(board, i, j, root, &result, &visited)
        }
    }
    return Array<String>(result)
}

func findWords(_ board: [[Character]], _ r: Int, _ c: Int, _ node: TreeNode, _ result: inout Set<String>, _ visited: inout [[Bool]]) {
    if r < 0 || r >= board.count || c < 0 || c >= board[r].count || visited[r][c] {
        return
    }

    let letter = board[r][c]
    let ascii = letter.toAsciiInt()! - Character("a").toAsciiInt()!

    guard letter >= Character("a"),
        letter <= Character("z"), 
        let node = node.nodes[ascii] else {
            return 
    }

    if node.word != nil {
        result.insert(node.word!)
    }

    visited[r][c] = true

    findWords(board, r-1, c, node, &result, &visited)
    findWords(board, r+1, c, node, &result, &visited)
    findWords(board, r, c-1, node, &result, &visited)
    findWords(board, r, c+1, node, &result, &visited)

    visited[r][c] = false
}


