func boggle(_ board: [[Character]], _ words: [String]) -> Int {
    let root = buildTrieTree(words)
    var visited = board.map { $0.map { $0 == nil } }
    var maxPath = 0
    for i in 0..<board.count {
        for j in 0..<board[i].count {
            maxPath = max(maxPath, boggle(board, i, j, root, &visited))
        }
    }
    return maxPath
}

func boggle(_ board: [[Character]], _ r: Int, _ c: Int, _ node: TreeNode, _ visited: inout [[Bool]]) -> Int {
    if r < 0 || r >= board.count || c < 0 || c >= board[r].count || visited[r][c] {
        return 0
    }

    let letter = board[r][c]
    let ascii = letter.toAsciiInt()! - Character("a").toAsciiInt()!

    guard letter >= Character("a"),
        letter <= Character("z"), 
        let node = node.nodes[ascii] else {
            return 0
    }

    var path = 0
    if node.word != nil {
        path += 1
    }

    visited[r][c] = true

    path += max(boggle(board, r-1, c, node, &visited),
                boggle(board, r+1, c, node, &visited),
                boggle(board, r, c-1, node, &visited),
                boggle(board, r, c+1, node, &visited))
    visited[r][c] = false
    print("current path: \(path), char: \(letter)")
    return path
}
