func calculate(_ s: String) -> Int {
    var result = 0
    var stack: [Int] = []
    var len = s.count, sign = 1, num = 0
    var i = 0
    while i<len {
        if i%1000 == 0 {
            print("progress: \( Double(i) / Double(s.count))")
        }
        let c = String(s[i])
        // print("c: \(c)")
        i += 1
        if "0123456789".contains(c) {
            // print("check 0")
            num = num * 10 + Int(c)!
            while i<len, "0123456789".contains(String(s[i])) {
                // print("check 1")
                num = num * 10 + Int(String(s[i]))!
                i += 1
            }
        } else if (c == "+" || c == "-") {
            // print("check 2")
            result += sign * num
            sign = (c == "+" ? 1 : -1)
            num = 0
        } else if c == "(" {
            // print("check 3")
            stack.append(result)
            stack.append(sign)
            result = 0
            sign = 1
        } else if c == ")" {
            // print("check 4")
            result += (sign * num)
            num = 0
            sign = 1
            result = result * stack.removeLast() + stack.removeLast()
        }
    }
    if num != 0 {
        result += (sign * num)
    }
    return result
}

func calculate1(_ s: String) -> Int {
    guard s.count > 0 else {
        return 0
    }

    var bracketOperatorStack: [Int] = []
    var bracketWithSubtractorCount = 0
    var index = 0
    var result = 0
    var tmp = 0
    var lastOperator = "+"
    while index <= s.count {
        if index%1000 == 0 {
            print("progress: \( Double(index) / Double(s.count))")
        }
        defer {
            index += 1
        }

        let c = (index == s.count ? "+" : String(s[index]))
        if "0123456789".contains(c) {
            tmp = tmp * 10 + Int(c)!
        } else if c == "(" {
            bracketOperatorStack.append(lastOperator == "+" ? 1 : -1)
            if lastOperator == "-" {
                bracketWithSubtractorCount += 1
            }
            lastOperator = ""
        } else if c == "+" || c == "-" || c == ")" {
            var sign = (bracketWithSubtractorCount % 2 == 0 ? 1 : -1)
            if lastOperator == "-" {
                sign *= -1
            }
            result += sign * tmp
            // print("tmp: \(tmp), result: \(result)")
            tmp = 0
            lastOperator = c

            if c == ")" {
                let isSubtractor = bracketOperatorStack.removeLast() == -1
                if isSubtractor {
                    bracketWithSubtractorCount -= 1
                
                }
            }
        }
    }
    return result
}
// print("10-(9+(8-(7+(6-(5+(4)-3)+1)))) = \(calculate("10-(9+(8-(7+(6-(5+(4)-3)+1))))"))")
func calculate2(_ s: String) -> Int {
    guard s.count > 0 else {
        return 0
    }

    var index = 0
    var result = 0
    var tmp = 0
    var previousTmp = 0
    var lastOperator = "+"
    while index <= s.count {
        defer {
            index += 1
        }

        let c = (index == s.count ? "+" : String(s[index]))
        if "0123456789".contains(c) {
            tmp = tmp * 10 + Int(c)!
        } else if c == "+" || c == "-" || c == "*" || c == "/" {
            switch lastOperator {
                case "+": 
                    result += tmp
                    previousTmp = tmp
                case "-":
                    result -= tmp
                    previousTmp = -tmp
                case "*": 
                    result = result - previousTmp + previousTmp * tmp
                    previousTmp = previousTmp * tmp
                case "/":
                    result = result - previousTmp + previousTmp / tmp
                    previousTmp = previousTmp / tmp
                default:
                    continue
            }
            lastOperator = c
            tmp = 0
        }
    }
    return result
