func printWater(_ waterHeight: [Int]) {
    let maxHeight = waterHeight.reduce(0){max($0, $1)}
    for i in stride(from: maxHeight, through: 1, by: -1) {
        for j in 0..<waterHeight.count {
            print(waterHeight[j] >= i ? "#" : " ", terminator:" ")
        }
        print("")
    }
    (0..<waterHeight.count).forEach{print($0, terminator:" ")}
    print("")
}

func printWater(_ waterHeight: [Int], _ waterHeightCopy: [Int]) {
    let maxHeight = waterHeightCopy.reduce(0){max($0, $1)}
    for i in stride(from: maxHeight, through: 1, by: -1) {
        for j in 0..<waterHeightCopy.count {
            if i > waterHeightCopy[j] {
                print(" ", terminator:" ")
            } else if i > waterHeight[j] {
                print("W", terminator:" ")
            } else {
                print("#", terminator:" ")       
            }
        }
        print("")
    }
    (0..<waterHeight.count).forEach{print($0, terminator:" ")}
    print("")
}

