func dropWater(_ waterHeight: [Int], _ index: Int, _ water: Int) -> [Int] {
    if index < waterHeight.count, water <= 0 {
        return waterHeight
    }

    var waterHeightCopy = waterHeight
    let count = waterHeightCopy.count

    for _ in 0...water {
        var left = index, right = index
        while left>0, waterHeightCopy[left-1] <= waterHeightCopy[left] {left -= 1}
        while left<index, waterHeightCopy[left+1] == waterHeightCopy[left] {left += 1}
        while right < count-1, waterHeightCopy[right+1] <= waterHeightCopy[right] {right += 1}
        while right>index, waterHeightCopy[right-1] == waterHeightCopy[right] {right -= 1}
        if left < index {
            waterHeightCopy[left] += 1
        } else {
            waterHeightCopy[right] += 1
        }
    }

    return waterHeightCopy
}

