func meetingTime(_ intervals: [[(start:Int, end: Int)]], _ k: Int) -> [(start: Int, end: Int)] {
    if k > intervals.count {
        fatalError("bad input")
    }
    var allTimes = (intervals.reduce(into: [(start: Int, end: Int)]()){$0.append(contentsOf: $1)}).reduce(into: [Int]()) { result, interval in 
        result.append(interval.start)
        result.append(-interval.end)
    }

    allTimes.sort{abs($0) < abs($1)}
    print(allTimes)
    let totalEmployees = intervals.count
    var busyEmployees = 0
    var availableTimes: [(start: Int, end: Int)] = []
    var start: Int? = abs(allTimes.first!)
    for time in allTimes {
        if time > 0 {
            busyEmployees += 1
        } else {
            busyEmployees -= 1
        }
        print("time: \(time), available employees: \(totalEmployees - busyEmployees)")
        if totalEmployees - busyEmployees >= k {
            if start == nil {
                start = abs(time)
                print("resetting start: \(start!)")
            }
        } else {
            if start != nil {
                if abs(time) > start! {
                    print("add times")
                    availableTimes.append((start: start!, end: abs(time)))
                }
                start = nil
            }
        }
    }
    if start != nil, abs(allTimes.last!) > start! {
        print("add times")
        availableTimes.append((start: start!, end: abs(allTimes.last!)))
    }

    return availableTimes
}

