func roundUp(_ prices: [Double]) -> [Int] {
    var totalDiff = 0.0
    let pricesCopy = prices.enumerated().map{ (offset, price) -> (rounded: Int, diff: Double, index: Int) in 
        let rounded = Int(price)
        totalDiff += price - Double(rounded)
        return (rounded: rounded, diff: price - Double(rounded), index: offset)
    }
    var sortedRoundedPrices = pricesCopy.sorted{$0.diff > $1.diff}
    var result = Array<Int>(repeating: 0, count: prices.count)
    for i in 0..<sortedRoundedPrices.count {
        let tuple = sortedRoundedPrices[i]
        result[tuple.index] = tuple.rounded
        if(totalDiff > 1.0) {
            result[tuple.index] += 1
            totalDiff -= 1
        }
    }
    return result
}

