enum Direction: Int {
    case up = 0, down, left, right
}

class SlidingPuzzle: CustomStringConvertible {
    var board: [[Int]]
    var visited: [[Bool]]
    var x: Int
    var y: Int
    var originX: Int
    var originY: Int

    var description: String {
        get {
            return board.reduce(""){$0 + $1.reduce(""){$0 + ($1 == 0 ? " " : String($1)) + ","} + "\n"}
        }
    }

    init(_ x: Int, _ y: Int) {
        self.board = Array<[Int]>(repeating: Array<Int>(repeating: 0, count: 3), count: 3)
        self.visited = Array<[Bool]>(repeating: Array<Bool>(repeating: false, count: 3), count: 3)
        self.originX = x
        self.x = x
        self.originY = y
        self.y = y
        var start = 1
        for i in 0..<3 {
            for j in 0..<3 {
                if i == x, j == y {
                    continue
                }
                self.board[i][j] = start
                start += 1
            }
        }
    }

    func shuffle(_ m: Int = 0) {
        var moves = m
        if moves == 0 {
            moves = Int(arc4random_uniform(5))
        }
        for i in stride(from: moves, through: 0, by: -1) {
            let randomDirection = Direction(rawValue: Int(arc4random_uniform(4)))
            if moved(randomDirection!) {
                moves -= 1
            }
        }
        print("finished shuffling")
    }

    func canSolve() -> Bool {
        
    }

    func moved(_ dir: Direction) -> Bool {
        var newX = self.x, newY = self.y
        switch dir {        
            case .up:
                newX = x - 1
            case .down:
                newX = x + 1
            case .left:
                newY = y - 1
            case .right:
                newY = y + 1
        }
        if newX < 0 || newX >= 3 || newY < 0 || newY >= 3 {
            return false
        }
        let tmp = self.board[self.x][self.y]
        self.board[self.x][self.y] = self.board[newX][newY]
        self.board[newX][newY] = tmp
        self.x = newX
        self.y = newY
        return true
    }
}

